static const int8_t conv2d_3_bias[] = CONV2D_3_BIAS_0;
static const nnom_bias_t conv2d_3_b = { (const void*)conv2d_3_bias, CONV2D_3_BIAS_LSHIFT};
static const int8_t conv2d_4_weights[] = CONV2D_4_KERNEL_0;
static const nnom_weight_t conv2d_4_w = { (const void*)conv2d_4_weights, CONV2D_4_OUTPUT_RSHIFT};
static const int8_t conv2d_4_bias[] = CONV2D_4_BIAS_0;
static const nnom_bias_t conv2d_4_b = { (const void*)conv2d_4_bias, CONV2D_4_BIAS_LSHIFT};
static const int8_t dense_1_weights[] = DENSE_1_KERNEL_0;
static const nnom_weight_t dense_1_w = { (const void*)dense_1_weights, DENSE_1_OUTPUT_RSHIFT};
static const int8_t dense_1_bias[] = DENSE_1_BIAS_0;
static const nnom_bias_t dense_1_b = { (const void*)dense_1_bias, DENSE_1_BIAS_LSHIFT};

/* nnom model */
static int8_t nnom_input_data[403];
static int8_t nnom_output_data[10];
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[14];

	new_model(&model);

	layer[0] = Input(shape(31, 13, 1), nnom_input_data);
	layer[1] = model.hook(Conv2D(16, kernel(5, 5), stride(1, 1), PADDING_VALID, &conv2d_1_w, &conv2d_1_b), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(MaxPool(kernel(2, 2), stride(1, 1), PADDING_VALID), layer[2]);
	layer[4] = model.hook(Conv2D(32, kernel(3, 3), stride(1, 1), PADDING_VALID, &conv2d_2_w, &conv2d_2_b), layer[3]);
	layer[5] = model.active(act_relu(), layer[4]);
	layer[6] = model.hook(MaxPool(kernel(2, 2), stride(1, 1), PADDING_VALID), layer[5]);
	layer[7] = model.hook(Conv2D(64, kernel(3, 3), stride(1, 1), PADDING_VALID, &conv2d_3_w, &conv2d_3_b), layer[6]);
	layer[8] = model.active(act_relu(), layer[7]);
	layer[9] = model.hook(Conv2D(32, kernel(3, 3), stride(1, 1), PADDING_VALID, &conv2d_4_w, &conv2d_4_b), layer[8]);
	layer[10] = model.active(act_relu(), layer[9]);
	layer[11] = model.hook(Dense(10, &dense_1_w, &dense_1_b), layer[10]);
	layer[12] = model.hook(Softmax(), layer[11]);
	layer[13] = model.hook(Output(shape(10,1,1), nnom_output_data), layer[12]);
	model_compile(&model, layer[0], layer[13]);
	return &model;
}
